    false,nt"url": null,nt"notes": "This dataset contains the 2012 four-year
    cohort graduation rates by district. The Connecticut State Department of Education
    (CSDE) introduced the four-year cohort graduation rate with the graduating class
    of 2009. This approach was created when Connecticut and 49 other states signed an
    agreement with the National Governorsu2019 Association to develop a uniform system
    for tracking students. The four-year cohort graduation rate is calculated by tracking
    an individual cohort, or group of students, from their initial entrance into Grade
    9 through to graduation. The four-year cohort graduation rate represents the percentage
    of students who earn a standard high school diploma within four years. The calculation
    uses individual student-level data from the state's Public School Information System
    (PSIS) that school districts submitted and superintendents certified.rn>> Double
    plus symbol (u2020u2020) denotes not applicablern>> Asterisk symbol (*) denotes
    fewer than six in a cohort is suppressedrn>> Outplaced students are counted only
    in district graduation calculationrn>> Row percentages may not add to 100 percent
    because of roundingrn>> District graduation rates may not be the same as the average
    of the graduation rates of the number schools in that district because of outplaced
    students.rn>> Because each cohort is different from one year to another year, graduation
    rates are not comparable from year to year. Caution interpreting the differences
    between the previous year and the current year rnrnCohort Graduation Rate Documentation:
